#Temporary mod files can take up a lot of space. Make sure that we delete these after the server has been shutdown.

from System.IO import Directory

if Directory.Exists(ThisService_RootDirectory + "Engine\\Binaries\\ThirdParty\\SteamCMD\\Win64\\steamapps\\workshop\\content\\346110\\"):
  #If the path is really long, deletion will sometimes fail. For this reason, we rename the folders to make the path shorter.
  try:
    Directory.Move(ThisService_RootDirectory + "Engine\\Binaries\\ThirdParty\\SteamCMD\\Win64\\steamapps\\workshop\\content\\346110\\", ThisService_RootDirectory + "Engine\\Binaries\\ThirdParty\\SteamCMD\\Win64\\s\\")
  except IOError, e:
    raise Exception("An error occurred. Please contact support. Error was: %s" % (e))


