import clr
clr.AddReference('TCAdmin.GameHosting.SDK')
from TCAdmin.GameHosting.SDK.Objects import Service
from System.IO import Directory
from System import Exception;

if not ThisService.Variables['clusterid']:
  raise Exception('Clustering is not enabled for your server.<br />You must enable clustering from your command line before you can reset the cluster.')
else:
  ThisServiceGame=Service(ThisService.ServiceId).GameName
  ThisServiceServerId = Service(ThisService.ServiceId).ServerId
  services = Service.GetServices(ThisUser, False)
  servicelist = []
  for service in services:
    if service.GameName == ThisServiceGame and ThisServiceServerId == service.ServerId and ThisService.Variables['clusterid'] == service.Variables['clusterid'] and ThisService.ServiceId != service.ServiceId and str(service.ServiceStatus) == "Running":
      servicelist.append(service.ServiceId)
      Script.WriteToConsole('Stopping '+str(service.IpAddress) + ':' + str(service.GamePort))
      service.Stop()
  if Directory.Exists(ThisService.Variables['ClusterPath'] + '/clusters/' + ThisService.Variables['clusterid']):
    try:
      Directory.Delete(ThisService.Variables['ClusterPath'] + '/clusters/' + ThisService.Variables['clusterid'], True)
    except IOError, e:
      raise Exception('Could not reset cluster. Error was: %s' % (e))
  else:
    Script.WriteToConsole('No cluster files found')

# Start the services again
for serviceid in servicelist:
  Script.WriteToConsole('Starting '+str(Service(serviceid).IpAddress) + ':' + str(Service(serviceid).GamePort))
  Service(serviceid).Start()
Script.WriteToConsole('All running services with matching Cluster ID has been restarted and the Cluster was reset.')

