import clr clr.AddReference("TCAdmin.GameHosting.SDK") clr.AddReference("TCAdmin.Interfaces")
from System.IO import File, Path from System.Text.RegularExpressions import Regex, RegexOptions from System import Environment, PlatformID, String from System.Threading import Thread from TCAdmin.GameHosting.SDK import rconClient from TCAdmin.GameHosting.SDK import RCONGameType from TCAdmin.Interfaces.Server import ServiceStatus
if ThisService.Status.ServiceStatus != ServiceStatus.Running : Script.WriteToConsole(String.Format("{0} is stopped. The script will not continue.", ThisService.ConnectionInfo)) Script.Exit()
serveros = "WindowsServer" if Environment.OSVersion.Platform == PlatformID.Win32NT else "LinuxServer" inifile = Path.Combine(ThisService.RootDirectory, String.Format("ShooterGame/Saved/Config/{0}/GameUserSettings.ini", serveros))
pattern="ServerAdminPassword[ \t]*=[ \t]*[\"]?(?<ServerAdminPassword>([^\"\r\n])*)[\"]?" filecontents = File.ReadAllText(inifile) match = Regex.Match(filecontents, pattern, RegexOptions.IgnoreCase)
if match.Success : rconpass = match.Groups["ServerAdminPassword"].Value Script.WriteToConsole(String.Format("RCon password is: {0}", rconpass))
rconclient=rconClient() rconclient.GameType = RCONGameType.CounterStrikeSource rconclient.Server = ThisService.IpAddress rconclient.Port = ThisService.RConPort Script.WriteToConsole("Sending update notification...") rconclient.Send(None, None, rconpass, "broadcast \"Server will update mods in 5 minutes!\"") Script.WriteToConsole(String.Format("RCon Response: {0}", rconclient.ReadResponse())) Script.WriteToConsole("Waiting for 5 minutes...") Thread.Sleep(300000) Script.WriteToConsole("Saving world...") rconclient.Send(None, None, rconpass, "saveworld") Script.WriteToConsole(String.Format("RCon Response: {0}", rconclient.ReadResponse())) Script.WriteToConsole("Done.")
